function [firstPair,secondPair,removedNumber] = cpu_moves(p,dice)

switch p.name
    case 'Legal (CPU)'
        [firstPair, secondPair, removedNumber]=cpu_legal(p,dice);
    case 'Greedy (CPU)'
        [firstPair, secondPair, removedNumber]=cpu_greedy(p,dice);
    case 'Smoothy (CPU)'
        [firstPair, secondPair, removedNumber]=cpu_smoothy(p,dice);
    case 'Snoopy (CPU)'
        [firstPair, secondPair, removedNumber]=cpu_snoopy(p,dice);
    case 'Harhar (CPU)'
        [firstPair, secondPair, removedNumber]=cpu_harhar(p,dice);
    case 'Hyperbrain (CPU)'
        [firstPair, secondPair, removedNumber]=cpu_hyperbrain(p,dice);
end
end


function [firstPair,secondPair,removedNumber] = cpu_legal(p,dice)
%
%%
%%%
%%% Name of this AI: Legal.
%%% Written by Bernhard Konrad; bernhard.konrad@gmail.com; June 10th 2013.
%%% 
%%%
%%% Your inputs are
%%% * p: [struct] with all details on the current stats of
%%%   your player Superbrain (CPU)
%%% * dice: [double] vector of the 5 dice numbers for this sound
%%%
%%% Your output [firstPair,secondPair,removedNumber] will have to form a
%%% valid move, i.e. pass isOK(p,dice,firstPair,secondPair).
%%%
%%% You are allowed to look at the stats of all players
%%% For this, use >> allPlayers=getAllPlayers();
%%%
%%% Have fun improving on this work!
%%%
%%
%

%Very simple AI. Will always make legal move (ie choose correct
%removedNumber). Does not change order of dice, just rotates them until
%dice(5) is an allowed removedNumber.
    while ~isOKremovedNumber(p,dice,dice(5))
        dice = circshift(dice,[0 -1]);
    end
    firstPair = dice(1)+dice(2);
    secondPair = dice(3)+dice(4);
    removedNumber = dice(5);   
end
    
    
    
function [firstPair, secondPair, removedNumber]=cpu_greedy(p,dice)
%
%%
%%%
%%% Name of this AI: Greedy.
%%% Written by Bernhard Konrad; bernhard.konrad@gmail.com; June 10th 2013.
%%%
%%
%

%optimizes current score for each round, disregards removed numbers.
permutations = perms(dice);
    validIndex = zeros(1,length(permutations));
    for i = 1:length(validIndex)
        validIndex(i) = isOK(p,dice,permutations(i,1)+permutations(i,2),permutations(i,3)+permutations(i,4));
    end
    permutations(~validIndex,:) = [];
    validIndex(~validIndex) = [];
    score = zeros(1,length(permutations));
    for i = 1:length(score)
        helper = updatePlayer(p,permutations(i,1)+permutations(i,2),permutations(i,3)+permutations(i,4),permutations(i,5));
        score(i) = helper.score;
    end
    optimizingIndex = find(score==max(score),1,'first');
    firstPair = permutations(optimizingIndex,1)+permutations(optimizingIndex,2);
    secondPair = permutations(optimizingIndex,3)+permutations(optimizingIndex,4);
    removedNumber = permutations(optimizingIndex,5);
end

    
    
    
function [firstPair,secondPair,removedNumber] = cpu_smoothy(p,dice)
%
%%
%%%
%%% Name of this AI: Smoothy.
%%% Written by Isabell Graf; grafisab@gmail.com; June 10th 2013.
%%%
%%
%

zahl = [50 56 82 45 28 40 100];

   candidate = allLegalMoves_smoothy(p,dice);
   
    number = {'Two','Three','Four','Five','Six','Seven','Eight','Nine','Ten','Eleven','Twelve'};
 
    score = zeros(1,size(candidate,1));
    
    for i = 1:length(score)
        firstpair=candidate(i,1);
        secondpair=candidate(i,2);
        removednumber=candidate(i,3);
        helper = updatePlayer(p,firstpair,secondpair,removednumber);
        score(i) = helper.score;
        
        %%% es wird belohnt, eine Zahl zum zweite, dritten oder vierten
        %%% Mal zu nehmen
        if eval(['p.number' number{firstpair-1} ' == 1;'])
            score(i) = score(i)+zahl(1);
        end
        if eval(['p.number' number{firstpair-1} ' == 2;'])
            score(i) = score(i)+zahl(2);
        end
        if eval(['p.number' number{firstpair-1} ' == 3;'])
            score(i) = score(i)+zahl(3);
        end
        if eval(['p.number' number{secondpair-1} ' == 1;'])
            score(i) = score(i)+zahl(1);
        end
        if eval(['p.number' number{secondpair-1} ' == 2;'])
            score(i) = score(i)+zahl(2);
        end
        if eval(['p.number' number{secondpair-1} ' == 3;'])
            score(i) = score(i)+zahl(3);
        end
        
       %%% es wird bestraft, eine 2 oder 12 zum ersten Mal zu nehmen
        if (((firstpair==2 || secondpair==2) && p.numberTwo == 0) || ((firstpair==12 || secondpair ==12) &&  p.numberTwelve == 0))
            score(i)=score(i) - zahl(4);
        end
        if (((firstpair==3 || secondpair==3) && p.numberThree == 0)|| ((firstpair==11 || secondpair ==11) &&  p.numberEleven == 0))
             score(i)=score(i) - zahl(5);
        end
        
        %%% es wird bestraft, eine Zahl oefters als 10 mal zu nehmen
        if eval(['p.number' number{firstpair-1} ' > 10;'])
            score(i) = score(i) - zahl(6);
        end
        if eval(['p.number' number{secondpair-1} ' > 10;'])
            score(i) = score(i)-zahl(6);
        end
        
        %%% es wird bestraft, wenn die Removednumbers zu weit auseinander
        %%% liegen
        removedNumbersCheck = max([abs(helper.removedNumbersTable1howOften-helper.removedNumbersTable2howOften),abs(helper.removedNumbersTable1howOften-helper.removedNumbersTable3howOften),abs(helper.removedNumbersTable2howOften-helper.removedNumbersTable3howOften)]);
        score(i)=score(i) - removedNumbersCheck*zahl(7);  
    end
    optimizingIndex = find(score==max(score),1,'first');
    firstPair = candidate(optimizingIndex,1);
    secondPair = candidate(optimizingIndex,2);
    removedNumber = candidate(optimizingIndex,3);
end



function candidate = allLegalMoves_smoothy(p,dice)

%get all possible legal moves
permutations = perms(dice);
validIndex = zeros(1,length(permutations));
for i = 1:length(validIndex)
    validIndex(i) = isOKremovedNumber(p,dice,permutations(i,5));
end
permutations(~validIndex,:) = [];
%validIndex(~validIndex) = [];

candidate = zeros(length(permutations),3);
%sum permuations to get candidate choices
for i=1:length(permutations)
    if permutations(i,1)+permutations(i,2) < permutations(i,3)+permutations(i,4)
        candidate(i,1) = permutations(i,1)+permutations(i,2);
        candidate(i,2) = permutations(i,3)+permutations(i,4);
    else
        candidate(i,1) = permutations(i,3)+permutations(i,4);
        candidate(i,2) = permutations(i,1)+permutations(i,2);     
    end
    candidate(i,3) = permutations(i,5);
end
candidate = unique(candidate,'rows');
end





function [firstPair,secondPair,removedNumber] = cpu_snoopy(p,dice)
%
%%
%%%
%%% Name of this AI: Snoopy.
%%% Written by Christian Nolde; June 10th 2013.
%%%
%%
%


%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%% preparations:
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
% vector of locked numbers
nocList = [p.removedNumbersTable1, ...
    p.removedNumbersTable2, ...
    p.removedNumbersTable3];
  
% vector how often a number has been locked
nocCount = [p.removedNumbersTable1howOften, ...
    p.removedNumbersTable2howOften, ...
    p.removedNumbersTable3howOften];

% vector that counts how often we picked a sum before
scoreboard = [ 0, p.numberTwo, p.numberThree, p.numberFour, p.numberFive, ...
  p.numberSix, p.numberSeven, p.numberEight, p.numberNine, p.numberTen, ...
  p.numberEleven, p.numberTwelve];

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%% define current situation
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
% number of remaining free slots for locked numbers
locksRemaining = 3 - length(find(nocList)) ;

% get numbers we can choose to lock
if(locksRemaining > 0 || isempty(intersect(dice,nocList)) )
  numbersToLock = unique(dice);
else
  numbersToLock = intersect(dice,nocList);
end

% num different combinations for a sum with respect to order
% experimental values
sumPos = [0,0.1985,0.3260,0.4908,0.5967,0.7229,0.7988,...
  0.7231,0.5935,0.4903,0.3294,0.1960];

% points you get per pick between 5 and 10
sumVal = [0 100 70 60 50 40 30 40 50 60 70 100];

% initialise "table" with possible turns 
% col 1: lock  __  2: firstPair __ 3: secPair __  4: "value"
turnTable = zeros(3*length(numbersToLock),4);

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%% function definitions
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
function val = evalPair_snoopy(x,scoreboard)
  if(scoreboard(x) == 0) % new number == bad
    val = -200 * (2-sumPos(x));
  elseif(scoreboard(x) > 0 && scoreboard(x) < 5) % try to remove negative values
    val = 40 * (1-sumPos(x)) * scoreboard(x); % todo normalize this
  elseif(scoreboard(x) >= 5 && scoreboard(x) < 10) % gather points
    val = sumVal(x);
  elseif(scoreboard(x) >= 10) % no gain no pain
    val = 0 ;
  end
end

% unsure whats the best strategy: keep them together at min/max or spread
function val = evalLock_snoopy(x,locksRemaining) 
  if( locksRemaining == 3 ) % prefer "extreme" values to start with
    if(x==1 || x==6)
      val = 25;
    elseif(x==2 || x==5)
      val = 10;
    else
      val = -10;
    end
  % keep locked numbers together
  % update: looks like spreading is better
  elseif( locksRemaining > 0 ) 
    % try to spread them
    val = (min(abs(x-nocList(1:3-locksRemaining))) ) * 50;
    if ( isempty(intersect(nocList,x)) ) % prevent usage of only one number
      val = val + 50;
    else
      val = val - 50* nocCount(nocList==x);
    end
  elseif(isempty(intersect(nocList,x))) % free pick
      val = 0;
  else % locks set up. try to equaly use the locks
    val = (max(nocCount) - nocCount(nocList==x)) * 150;    
  end   
end

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%% evaluate everything
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
for i = 1:length(numbersToLock) % set up possible turns
  tempDice = dice;
  tempDice(find(tempDice == numbersToLock(i),1)) = [];
  
  turnTable((i-1)*3 + 1, 1) = numbersToLock(i);
  turnTable((i-1)*3 + 1, 2) = tempDice(1) + tempDice(2);
  turnTable((i-1)*3 + 1, 3) = tempDice(3) + tempDice(4);
  
  turnTable((i-1)*3 + 2, 1) = numbersToLock(i);
  turnTable((i-1)*3 + 2, 2) = tempDice(1) + tempDice(3);
  turnTable((i-1)*3 + 2, 3) = tempDice(2) + tempDice(4);
  
  turnTable((i-1)*3 + 3, 1) = numbersToLock(i);
  turnTable((i-1)*3 + 3, 2) = tempDice(1) + tempDice(4);
  turnTable((i-1)*3 + 3, 3) = tempDice(3) + tempDice(2);
end

for i = 1:size(turnTable,1)  
  % how good is the locked number?
  valueLockedNum = evalLock_snoopy(turnTable(i,1),locksRemaining);  
  % how good is the first pair? % would be better to evaluate both together
  valueFirstPair = evalPair_snoopy(turnTable(i,2),scoreboard);  
  % how good is the second pair?
  tempScoreboard = scoreboard;
  tempScoreboard(turnTable(i,2)) = tempScoreboard(turnTable(i,2))+1;
  
  valueSecondPair = evalPair_snoopy(turnTable(i,3),tempScoreboard);
  
  turnTable(i,4) = valueLockedNum + valueFirstPair + valueSecondPair;
end

[val , index] = max(turnTable(:,4));

removedNumber = turnTable(index,1);
firstPair = turnTable(index,2);
secondPair = turnTable(index,3);

end %function




function [firstPair,secondPair,removedNumber] = cpu_harhar(p,dice)
%
%%
%%%
%%% Name of this AI: Harhar 007.
%%% Written by Bernhard Konrad; bernhard.konrad@gmail.com; June 10th 2013.
%%%
%%
%

pars=[0 25.339 46.698 15.008 31.183 2.2806 145.5 219.88];

candidate = allLegalMoves_harhar(p,dice);

phase = whichPhase_harhar(p.removedNumbersTable1howOften,p.removedNumbersTable2howOften,p.removedNumbersTable3howOften);

baseScoreVector = [0,0,3,1,2,1,2,1,3,0,0];
vectorOfChosenPairs = getVectorOfChosenPairs_harhar(p);
vectorNotMoreOftenThanTenTimes = getVectorNotMoreOftenThanTenTimes_harhar(p);
vectorOfNoncompletePairs = getVectorOfNoncompletePairs_harhar(p);
vectorOfNoncompletePairsWeighted = getVectorOfNoncompletePairsWeighted_harhar(p);


switch phase
    case 'firstMove'
        %just concentrate on "good" numbers
        phaseScoreVector = baseScoreVector;
        penaltyFactor = 0;
    case 'opening'
        %take numbers into account that were already chosen
        phaseScoreVector = baseScoreVector + 2*vectorOfChosenPairs;
        penaltyFactor = pars(1);
    case 'midgame'
        %prefer numbers that give better score
        phaseScoreVector = pars(2)*vectorOfNoncompletePairs.*vectorOfNoncompletePairsWeighted + pars(3)*[100,70,60,50,40,30,40,50,60,70,100].*vectorOfChosenPairs.*vectorNotMoreOftenThanTenTimes;
        penaltyFactor = pars(4);
    case 'endgame'
        %try to stay in the game, focus on completing pairs
        phaseScoreVector = pars(5)*vectorOfNoncompletePairs.*vectorOfNoncompletePairsWeighted + pars(6)*[100,70,60,50,40,30,40,50,60,70,100].*vectorOfChosenPairs.*vectorNotMoreOftenThanTenTimes;
        penaltyFactor = pars(7);
        
        %add case 'lastmove'
end

sizeHelp = size(candidate);
score = zeros(1,sizeHelp(1));
for i=1:sizeHelp(1)
    firstPairCandidate = candidate(i,1);
    secondPairCandidate = candidate(i,2);
    removedNumberCandidate = candidate(i,3);
    helper = updatePlayer(p,candidate(i,1),candidate(i,2),candidate(i,3));
    helpVector = putDiceInVector_harhar(candidate(i,1),candidate(i,2));
    pairPoints = helpVector.*phaseScoreVector;
    maxDifferenceRemovedNumbers = max([helper.removedNumbersTable1howOften,helper.removedNumbersTable2howOften,helper.removedNumbersTable3howOften])-min([helper.removedNumbersTable1howOften,helper.removedNumbersTable2howOften,helper.removedNumbersTable3howOften]);
    score(i) = sum(pairPoints) - penaltyFactor*(maxDifferenceRemovedNumbers) - pars(8)*opensNewNumber_harhar(p,firstPairCandidate,secondPairCandidate);
end

%%help for output%%
withScore = zeros(sizeHelp(1),sizeHelp(2)+1);
for i=1:sizeHelp(1)
    withScore(i,1) = candidate(i,1);
    withScore(i,2) = candidate(i,2);
    withScore(i,3) = candidate(i,3);
    withScore(i,4) = score(i);
end
%%end help for output%%


optimizingIndex = find(score==max(score),1,'first');
firstPair = candidate(optimizingIndex,1);
secondPair = candidate(optimizingIndex,2);
removedNumber = candidate(optimizingIndex,3);
end


function phaseString = whichPhase_harhar(a,b,c)
if all([a,b,c]==0)
    phaseString = 'firstMove';
elseif any([a,b,c]==0)
    phaseString = 'opening';
elseif max([a,b,c]) < 5
    phaseString = 'midgame';
else
    phaseString = 'endgame';
end
end


function vector = getVectorOfChosenPairs_harhar(p)
vector = zeros(1,11);
counter=1;
for number = {'Two','Three','Four','Five','Six','Seven','Eight','Nine','Ten','Eleven','Twelve'}
    howOften = eval(['p.number' number{1}]);
    vector(counter) = (howOften>0);
    counter=counter+1;
end
end


function vector = getVectorOfNoncompletePairs_harhar(p)
vector = zeros(1,11);
counter=1;
for number = {'Two','Three','Four','Five','Six','Seven','Eight','Nine','Ten','Eleven','Twelve'}
    howOften = eval(['p.number' number{1}]);
    vector(counter) = (howOften>0 && howOften<5);
    counter=counter+1;
end
end


function vector = getVectorOfNoncompletePairsWeighted_harhar(p)
vector = getVectorOfNoncompletePairs_harhar(p);
counter=1;
for number = {'Two','Three','Four','Five','Six','Seven','Eight','Nine','Ten','Eleven','Twelve'}
    howOften = eval(['p.number' number{1}]);
    vector(counter) = (howOften>0 && howOften<5);
    vector(counter) = vector(counter)*howOften;
    counter=counter+1;
end
end


function vector = getVectorNotMoreOftenThanTenTimes_harhar(p)
vector = zeros(1,11);
counter=1;
for number = {'Two','Three','Four','Five','Six','Seven','Eight','Nine','Ten','Eleven','Twelve'}
    howOften = eval(['p.number' number{1}]);
    vector(counter) = (howOften<10);
    counter=counter+1;
end
end


function vector = putDiceInVector_harhar(a,b)
vector = zeros(1,11);
vector(a-1)=1;
vector(b-1)=vector(b-1)+1;
end


function howManyNew = opensNewNumber_harhar(p,fPair,sPair)
howManyNew=0;
counter=2;
for number = {'Two','Three','Four','Five','Six','Seven','Eight','Nine','Ten','Eleven','Twelve'}
    howOften = eval(['p.number' number{1}]);
    if (howOften==0 && counter==fPair)
        howManyNew=howManyNew+1;
    end
    if (howOften==0 && counter==sPair)
        howManyNew=howManyNew+1;
    end
    counter=counter+1;
end
if fPair==sPair && howManyNew==2
    howManyNew=1;
end
end


function candidate = allLegalMoves_harhar(p,dice)
%get all possible legal moves
permutations = perms(dice);
validIndex = zeros(1,length(permutations));
for i = 1:length(validIndex)
    validIndex(i) = isOKremovedNumber(p,dice,permutations(i,5));
end
permutations(~validIndex,:) = [];
%validIndex(~validIndex) = [];


candidate = zeros(length(permutations),3);
%sum permuations to get candidate choices
for i=1:length(permutations)
    if permutations(i,1)+permutations(i,2) < permutations(i,3)+permutations(i,4)
        candidate(i,1) = permutations(i,1)+permutations(i,2);
        candidate(i,2) = permutations(i,3)+permutations(i,4);
    else
        candidate(i,1) = permutations(i,3)+permutations(i,4);
        candidate(i,2) = permutations(i,1)+permutations(i,2);     
    end
    candidate(i,3) = permutations(i,5);
end
candidate = unique(candidate,'rows');
end







