            newN(firstNumber - 1) = newN(firstNumber - 1) + 1;
            newN(secondNumber - 1) = newN(secondNumber - 1) + 1;
            newD = discarded;
            if ~freeRoll
                newD(d) = newD(d) + 1;
            end
            
            inputValues = zeros(1, 46);
            for i = 1:11
                inputValues(i) = 0.2 * (newN(i) - 5);
                if newN(i) == 0
                    inputValues(i + 17) = -1.0;
                else
                    inputValues(i + 17) = 1.0;
                end
                if newN(i) < 5
                    inputValues(i + 34) = 1.0;
                else
                    inputValues(i + 34) = -1.0;
                end
            end
            for i = 1:6
                inputValues(i + 11) = (newD(i) - 3.5) / 3.5;
                if newD(i) == 0
                    inputValues(i + 28) = -1.0;
                else
                    inputValues(i + 28) = 1.0;
                end                
            end
            inputValues(46) = 1.0;

            x = 0.0;
            o = 0.0;
            for j = 1:hiddenNum
                x = 0.0;
                for i = 1:46
                    x = x+ W(j, i) * inputValues(i);
                end
                h = 1.0 / (1 + exp(-x));
                o = o + W(j, 47) * h;
            end
            v = 1.0 / (1 + exp(-o));
        
            if v >= value
                firstPair = firstNumber;
                secondPair = secondNumber;            
                removedNumber = d;
                value = v;
            end

        end
            
    end
end